import './home.scss';
import React from "react";
import Navbar from '../components/navbar/Navbar';
import Featured from '../components/featured/Featured';

const Home = () => {
  return(
    <div className="home">
      <Navbar />
      <img
        width='100%'
        src="https://wallpaperaccess.com/full/3084028.jpg" 
        alt="Profile" 
      />
     <Featured />
    </div>
  )
}

export default Home;
